import Footer from "./components/Footer";
import Header from "./components/Header";
import Icons from "./components/Icons";
import Metrics from "./components/Metrics";

function App() {
  return (
    <div>
      <Header/>
      <div className="max-w-7xl mx-auto ">
      <Icons/>
      </div>
      <Metrics/>
      <Footer/>
    </div>
  );
}

export default App;
